import React, { useContext } from "react";
import Acontext from './Context' 


const About = ()=>{
    const a = useContext(Acontext);
    return(
        <div>
            <h3> Hello Mr. Anurag You have Assigned a mission</h3>
             {a.data.mname}
             {a.data.agent}
             {a.data.status}
        </div>
    )
}
